import React from 'react'
import  HeaderLogo   from './HeaderLogo';
import  SearchBar  from './SearchBar';
import  NavBar  from './NavBar';
import  UserProfile  from './UserProfile';
import ''

  function Header() {
  return (
    <div className="topHeader">
        <div> 
          <HeaderLogo/>
          <SearchBar/>
        </div>
        <div>
          <NavBar/>
        </div>
        <div>
            <UserProfile />
        </div>
    </div>
  )
}

export default Header;
